import React , { Component } from 'react';


function Navbar (){

    return (

  <>
    <a href="#" className="logo">WEBoxing</a>
     <nav className="navigation">
         <a href="#">Accueil</a>
         <a href="#">Connexion</a>
         <a href="#">Inscription</a>
         <a href="#">Contact</a>
     </nav>
 </>


    )
}


export default Navbar ;
